(string) (len=99423) "IDENT\tSUBROUTINE\nIDENT\tSYMSF\n(\t(\nIDENT\tFONT\n,\t,\nIDENT\tSWCHAR\n)\t)\nCOMMENT\tC     (Select Font)\nCOMMENT\tC     Select  one  of  the  Hershey  fonts  for  subsequent  text\nCOMMENT\tC     plotting.  Up to five fonts may  be in effect at one  time.\nCOMMENT\tC     The last selected is  the default one.   If more than  five\nCOMMENT\tC     fonts are requested, the sixth will replace the first,  the\nCOMMENT\tC     seventh the second, and  so on in  a cyclic fashion.   This\nCOMMENT\tC     restriction  is  purely  dimensional,  and  may  easily  be\nCOMMENT\tC     changed  if  required.   The  case  switch  characters  are\nCOMMENT\tC     initialized to  \"<\"  and  \">\"  for  to-upper  and  to-lower\nCOMMENT\tC     respectively.    The   backspace   character   switch    is\nCOMMENT\tC     initialized to 0, suppressing the backspace facility.   The\nCOMMENT\tC     arguments are:\nCOMMENT\tC\nCOMMENT\tC     FONT(*).....5-character string selecting font (see below).\nCOMMENT\tC     SWCHAR(*)...Single  character (e.g. 1H=)  used  as a switch\nCOMMENT\tC                 character to return to this font from  another.\nCOMMENT\tC                 It will be interpreted as a switch character if\nCOMMENT\tC                 it occurs only  once.  However, two  successive\nCOMMENT\tC                 switch characters  for a  single font  will  be\nCOMMENT\tC                 collapsed to a single character and will not be\nCOMMENT\tC                 interpreted as a font switch.  A blank or  zero\nCOMMENT\tC                 value indicates  that  no switch  character  is\nCOMMENT\tC                 selected.\nCOMMENT\tC\nCOMMENT\tC     The fonts are selected by  a five-character string made  up\nCOMMENT\tC     of a  2-character case  specification, a  2-character  type\nCOMMENT\tC     specification, and a 1-character variant specification,  as\nCOMMENT\tC     follows:\nCOMMENT\tC\nCOMMENT\tC     Case: UC - Upper Case\nCOMMENT\tC           LC - Lower Case\nCOMMENT\tC\nCOMMENT\tC     Type: KR - Cartographic Roman (9)\nCOMMENT\tC           KG - Cartographic Greek (9)\nCOMMENT\tC           IR - Indexical Roman (13)\nCOMMENT\tC           II - Indexical Roman Italic (13)\nCOMMENT\tC           IG - Indexical Greek (13)\nCOMMENT\tC           SA - Simplex ASCII (15)\nCOMMENT\tC           BA - Block ASCII (15)\nCOMMENT\tC           SR - Simplex Roman (21)\nCOMMENT\tC           SS - Simplex Roman Script (21)\nCOMMENT\tC           SG - Simplex Greek (21)\nCOMMENT\tC           CR - Complex Normal Roman (21)\nCOMMENT\tC           CI - Complex Normal Roman Italic (21)\nCOMMENT\tC           CG - Complex Normal Greek (21)\nCOMMENT\tC           CS - Complex Script (21)\nCOMMENT\tC           DR - Duplex Roman (21)\nCOMMENT\tC           TR - Triplex Roman (21)\nCOMMENT\tC           GE - Gothic English (21)\nCOMMENT\tC           GI - Gothic Italian (21)\nCOMMENT\tC           GG - Gothic German (21)\nCOMMENT\tC           CC - Complex Cyrillic (21)\nCOMMENT\tC\nCOMMENT\tC     Variant: 1 - Principal\nCOMMENT\tC              2 - Secondary\nCOMMENT\tC              3 - Tertiary\nCOMMENT\tC              4 - Quaternary\nCOMMENT\tC\nCOMMENT\tC     Selector letters may be  either upper- or lower-case.   The\nCOMMENT\tC     case specification is arranged  such that if upper-case  is\nCOMMENT\tC     requested, upper-case text will be mapped into  upper-case,\nCOMMENT\tC     and  lower-case   into   lower-case.   If   lower-case   is\nCOMMENT\tC     requested, both upper-  and lower-case  letters are  mapped\nCOMMENT\tC     into lower case.  The four  variants are provided to  allow\nCOMMENT\tC     representation of  special  characters within  the  limited\nCOMMENT\tC     FORTRAN set.  The Gothic and  Cyrillic fonts have only  two\nCOMMENT\tC     variants available.  Requests for variants  3 or 4 will  be\nCOMMENT\tC     reduced to  variant  2.   The ASCII  fonts  have  only  one\nCOMMENT\tC     variant, and  requests for  variants  2, 3,  or 4  will  be\nCOMMENT\tC     reduced to variant 1.\nCOMMENT\tC\nCOMMENT\tC     The numbers (9),  (13), (15), and  (21) following the  type\nCOMMENT\tC     indicate the height of the characters in raster units.  The\nCOMMENT\tC     spacing between lines of text is conventionally measured by\nCOMMENT\tC     the printer's  unit  \"em\",  giving the  distance  from  the\nCOMMENT\tC     bottom of one line of type to the bottom of the next  line.\nCOMMENT\tC     It should be  21 raster  units for indexical  size, and  32\nCOMMENT\tC     raster units for normal size.\nCOMMENT\tC\nCOMMENT\tC     If any of the three parts  of the font specification is  in\nCOMMENT\tC     error, a message  will be  issued, and a  default for  that\nCOMMENT\tC     part will be assumed.  The default corresponds to  \"UCTR1\".\nCOMMENT\tC     (01-APR-83)\nCOMMENT\tC  - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - -\nCOMMENT\tC\nCOMMENT\tC     EXTERNAL REFERENCES (FUNCTION,SUBROUTINE,COMMON)\nCOMMENT\tC\nCOMMENT\tC     EXTERNAL REFS       ERRAT,       ERRCK,       ERRMS,       KARASC\nCOMMENT\tC     EXTERNAL REFS       KARCM2,      KARUC,       KARUPK,      MIN0\nCOMMENT\tC     EXTERNAL REFS       MOD\nCOMMENT\tC\nCOMMENT\tC  - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - -\nCOMMENT\tC\nCOMMENT\tC     EXTERNAL FUNCTIONS AND SUBROUTINES\nCOMMENT\tC\nIDENT\tINTEGER\nIDENT\tKARASC\n,\t,\nIDENT\tKARCM2\n,\t,\nIDENT\tKARUC\nCOMMENT\tC  - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - -\nCOMMENT\tC\nCOMMENT\tC     INTRINSIC FUNCTIONS\nCOMMENT\tC\nIDENT\tINTEGER\nIDENT\tMIN0\n,\t,\nIDENT\tMOD\nCOMMENT\tC  - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - -\nCOMMENT\tC\nCOMMENT\tC     Working variables\nCOMMENT\tC\nIDENT\tINTEGER\nIDENT\tFCASE\n,\t,\nIDENT\tFONT\n(\t(\nIDENT\t1\n)\t)\n,\t,\nIDENT\tFTYPE\n,\t,\nIDENT\tFVAR\nIDENT\tINTEGER\nIDENT\tI\n,\t,\nIDENT\tIDIG\n,\t,\nIDENT\tILC\n,\t,\nIDENT\tIUC\nIDENT\tINTEGER\nIDENT\tLOC0